import React from 'react'

export function getTheme() {
    const theme = {

        global: {
          colors: {
            brand: 'rgb(180, 119, 26)',
            },
          font: {
            family: 'Roboto',
            size: '18px',
            height: '20px',
          },
        },
      };

    return theme;
}
